export const APP_NAME = 'DeepData';
export const APP_PREFIX_PATH = '/admin';
export const APP_DASHBOARD_PATH = `${APP_PREFIX_PATH}/dashboard`;
export const RTL_PREFIX_PATH = '/rtl';
export const AUTH_PREFIX_PATH = '/auth';
export const AUTH_SIGN_IN_PATH = `${AUTH_PREFIX_PATH}/login`;
export const AUTH_SIGN_UP_PATH = `${AUTH_PREFIX_PATH}/register`;
